import React from "react";

const Button = ({ actiontype, action }) => {
  return (
    <>
      <button className="submit-button" type="submit" onClick={action}>
        {!comfirmLoader ? (
          { actiontype }
        ) : (
          <img
            src="../assets/loaders/loader_white.svg"
            alt=""
            className="w-[20px] mx-auto"
          />
        )}
      </button>
    </>
  );
};

export default Button;
